import styled from "styled-components"

export const Container = styled.div`
 text-align: center;
 font-size:50px;
 width:100px;
 height: 500px;
 box-shadow: 3px 9px 30px rgb(10, 10, 10);
 background:linear-gradient(315deg, #dad7d7 20%, #121224 74%);
 border-radius: 9px;
`;
